import React, { Component } from 'react'
import ClassTest from './ClassTest'

class ClassProps extends Component {
  render() {
    return (
      
      <div class="container-main">
        <div class="form-container">
          <ClassTest employeename="Andrei Agbisit"
          employeeposition="President" company="Tarnation Evaporated Milk Manufacturing Co."/><br/>

          <ClassTest employeename="Paul Dano"
          employeeposition=" Vice President" company="Tarnation Evaporated Milk Manufacturing Co."/><br/>

          <ClassTest employeename="Thom Yorke"
          employeeposition="Manager" company="Tarnation Evaporated Milk Manufacturing Co."/>        
        </div>
      </div>
    )
  }
}

export default ClassProps
